import React from "react";

import "./css/footer.css"

export default function Footer(){
    return(
        <>
            <div className="d-flex col-12 text-center footer">
                <h1 className="d-flex justify-content-center col-2 elemento">Academy</h1>
                <p className="col-10 elemento">Buscamos excelencia em passar o conhecimento</p>
            </div>
        </>
    );

};
